<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br>Les concepts cars des salons automobiles ont traditionnellement attiré l'attention par leur style de carrosserie scandaleux, mais les démonstrateurs avancés d'aujourd'hui mettent au moins autant l'accent sur les gadgets de haute technologie à l'intérieur.&nbsp;Les apparitions récentes de grandes marques automobiles ont impressionné le public avec de grands écrans tactiles qui centralisent l'accès à tout, des contacts du téléphone portable, du contenu multimédia et des médias sociaux à la navigation, à l'aide au stationnement et au diagnostic graphique du véhicule.

Bon nombre des dernières voitures de milieu de gamme ont désormais été lancées avec une console centrale graphique pour la navigation, la communication et les diagnostics, tandis que les marques haut de gamme commencent à proposer des applications de voiture connectée offrant un accès Internet et des services à valeur ajoutée à leurs clients.

Les demandes pour de telles innovations proviennent de plusieurs directions : les acheteurs de voitures attendent une expérience utilisateur améliorée, les législateurs imposent des systèmes visant à améliorer la sécurité routière et les constructeurs automobiles cherchent à se connecter plus étroitement avec leurs clients grâce à des services électroniques à valeur ajoutée. Un aspect commun des systèmes qui émergent actuellement est que l'unité principale à écran tactile représente le lien d'une diversité toujours croissante de signaux d'entrée tels que la télévision et le DVD, la vidéo en direct et les graphiques provenant de systèmes avancés d'aide à la conduite, les informations d'état provenant de divers capteurs du véhicule, Communications Bluetooth, GPS et cartographie, et contenu Internet tel que les mises à jour du trafic, les flux d'actualités et les notifications sur les réseaux sociaux.

La conception de l'<b>interface utilisateur</b> est essentielle si les conducteurs veulent tirer le meilleur parti de l'interaction avec le système sans subir de distractions ou de surcharge d'informations. Les considérations des concepteurs s'étendent au-delà de la présentation et de la structure des menus pour englober de multiples façons d'interagir avec le système; le toucher, le geste et la commande vocale seront tous nécessaires, en plus du contrôle à l'aide des boutons de la console et du volant.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
